import React from "react";
import { GlobalContext } from "./GlobalContext";

const Produto = () => {
  const global = React.useContext(GlobalContext);

  global.map((item) => {
    return <p>{item.id[0]}</p>;
  });

  return (
    <div>
      <div>
        <h2>Produto</h2>
        <p>{}</p>
      </div>
    </div>
  );
};

export default Produto;
